import React from "react";
import { Device, Strings } from "../../Constant";
import styled from "styled-components";

const Head = styled.h1`
  color: black;

  font-family: "Inter";

  @media ${Device.mobileS} {
    font-size: 0.5rem;
  }
  @media ${Device.mobileM} {
    font-size: 0.7rem;
  }
  @media ${Device.mobileL} {
    font-size: 1rem;
  }
  @media ${Device.laptop} {
    font-size: 1.6rem;
  }
  @media ${Device.laptopL} {
    font-size: 1.6rem;
  }
  @media ${Device.desktop} {
    font-size: 1.6rem;
  }
`;

const SubText = styled.p`
  color: #99a1b2;
  font-family: "Inter";

  @media ${Device.mobileS} {
    font-size: 1;
  }
  @media ${Device.mobileM} {
    font-size: 13;
  }
  @media ${Device.mobileL} {
    font-size: 13;
  }
  @media ${Device.laptop} {
    font-size: 1;
  }
  @media ${Device.laptopL} {
    font-size: 1;
  }
  @media ${Device.desktop} {
    font-size: 13;
  }
  @media ${Device.desktopL} {
    font-size: 13;
  }
`;

const Header = (props) => {
  return (
    <div>
      <Head>{Strings.WELCOME}</Head>
      <SubText>{Strings.YOU_CAN_CHANGE}</SubText>
    </div>
  );
};

export default Header;
